import React, { useEffect, useState } from 'react'
import { useNavigate } from 'react-router-dom'
import first from './Img/homepage.jpg'
import sec from './Img/003.jpg'
import third from './Img/02.jpeg'
import four from './Img/002.jpg'
import five from './Img/002.png'
import six from './Img/03.jpeg'
function Test({fixedmenu}) {
    let navigate = useNavigate();
    const Menu = [
        {
            Title: 'About',
            Logo: 'fa fa-info',
            List: [
                {
                    l: 'Vision and Mission',
                    link:'/MissionandVision'
                }, {
                    l: 'Infrastructure: At a glance',
                    link:'/Infrastructure'
                }, {
                    l: "HOD's Message",
                    link:'/messageofHOD'
                }, {
                    l: 'Achievements',
                    link:'/achievements'
                }, {
                    l: 'Contact Us',
                    link:'/contactus'
                }
            ],
        }, {
            Title: 'Academic',
            Logo: 'fa fa-university',
            List: [
                {
                    l: 'Programmes',
                    link:'/Programme'
                }, {
                    l: 'Academic Coordinates',
                    link:'/Acadcord'
                }, {
                    l: 'Syllabus',
                    link:'/Syllabus'
                }, {
                    l: 'Time-Tables',
                    link:'/Timetable'
                }, {
                    l: 'Department Activities Calendar',
                    link:''
                }
            ],
            open:false
        }, {
            Title: 'People',
            Logo: 'fa fa-person',
            List: [
                {
                    l: 'Faculty',
                    link:''
                }, {
                    l: 'PhD Scholars',
                    link:''
                }, {
                    l: 'Students',
                    link:''
                }, {
                    l: 'Alumni*',
                    link:''
                }, {
                    l: 'Staff',
                    link:''
                }
            ],
            open:false
        }, {
            Title: 'Research and Labs',
            Logo: 'fa fa-flask',
            List: [
                {
                    l: 'Research Areas',
                    link:''
                }, {
                    l: 'Department Labs',
                    link:''
                }, {
                    l: 'Publications(Year-Wise)',
                    link:''
                }, {
                    l: 'Projects',
                    link:''
                }, {
                    l: 'Consultancy',
                    link:''
                },{
                    l: 'Research Labs',
                    link:''
                }
            ],
            open:false
        },{
            Title: 'Join Us',
            Logo: 'fa fa-flask',
            List: [
                
            ],
            link:''
        },
    ]
    return (
        <>
            <div className={"bottom-0 flex flex-col items-center w-60 h-[78vh] overflow-x-hidden text-gray-700 rounded "+(fixedmenu?'fixed':'absolute')}>
                <a className="flex items-center w-full px-3 mt-3" href="#">
                    <svg className="w-8 h-8 fill-current" xmlns="http://www.w3.org/2000/svg" viewBox="0 0 20 20" fill="currentColor">
                        <path d="M11 17a1 1 0 001.447.894l4-2A1 1 0 0017 15V9.236a1 1 0 00-1.447-.894l-4 2a1 1 0 00-.553.894V17zM15.211 6.276a1 1 0 000-1.788l-4.764-2.382a1 1 0 00-.894 0L4.789 4.488a1 1 0 000 1.788l4.764 2.382a1 1 0 00.894 0l4.764-2.382zM4.447 8.342A1 1 0 003 9.236V15a1 1 0 00.553.894l4 2A1 1 0 009 17v-5.764a1 1 0 00-.553-.894l-4-2z" />
                    </svg>
                    <span className="ml-2 text-xl font-bold">Menu</span>
                </a>

                <div className="flex flex-col items-center w-full h-full overflow-y-auto scrollbar mt-3 border-t border-gray-300">
                    <span className="flex items-center w-full h-12 px-3 mt-2 rounded hover:bg-gray-300"onClick={() => { navigate('/')}}>
                        <svg className="w-6 h-6 stroke-current" xmlns="http://www.w3.org/2000/svg" fill="none" viewBox="0 0 24 24" stroke="currentColor">
                            <path strokeLinecap="round" strokeLinejoin="round" strokeWidth="2" d="M3 12l2-2m0 0l7-7 7 7M5 10v10a1 1 0 001 1h3m10-11l2 2m-2-2v10a1 1 0 01-1 1h-3m-6 0a1 1 0 001-1v-4a1 1 0 011-1h2a1 1 0 011 1v4a1 1 0 001 1m-6 0h6" />
                        </svg>
                        <span className="ml-2 font-medium">Home</span>
                    </span>
                    {
                        Menu.map((item, i) => {

                            return (
                                <div key={i} className='w-full'>
                                    <span className="flex items-center w-full h-12 px-3 mt-2 rounded hover:bg-gray-200" onClick={()=>item.open?item.open=false:item.open=false}>
                                        <i className={ "pl-1 w-6 h-6 stroke-current "+item.Logo}></i>
                                        <span className="ml-1 font-medium">{item.Title}</span>
                                    </span>
                                    <ul id="dropdown-example" className={"py-2 space-y-2 transition-all group-hover:transition-all "+(item.open?'block':'hidden')}>
                                        {
                                            item.List.map((iteml, j) => {
                                                return (
                                                    <li key={j}>
                                                        <span className="inline-block p-1 text-sm font-normal text-gray-900 transition duration-75 group hover:bg-gray-300 ml-11 cursor-pointer" onClick={() => { navigate(iteml.link); }}>{iteml.l}</span>
                                                    </li>
                                                )
                                            })
                                        }
                                    </ul>
                                </div>
                            )
                        })
                    }
                </div>
            </div>
        </>
    )
}

export default Test
